import Empleado from "./Empleado.json";
import React from 'react';
{Empleados.map(person => {
  return (
   <List.Item block key={person.id}>
      <List.Content>
        {person.img-perfil}
        {person.Nombre} 
      </List.Content>
    <List.Content>{person.cargo}</List.Content>
   </List.Item>
  )
})}

export default Empleados;

